// Process all items from the input
const items = $input.all();

// Map through all items and extract/transform data
return items.map(item => {
  const customFields = item.json.customFields || [];

  // ‚ö†Ô∏è IMPORTANT: Replace these field IDs with YOUR HighLevel custom field IDs
  // Find the lead score field (Replace 'sEic9OWa5yndTAitjgoe' with your field ID)
  const leadScoreField = customFields.find(field => field.id === 'YOUR_LEAD_SCORE_FIELD_ID');
  const leadScore = leadScoreField ? parseFloat(leadScoreField.value) : 0;

  // Extract assigned rep (Replace 'YHJqNOSAvMbI08mnabNb' with your field ID)
  const assignedRepField = customFields.find(field => field.id === 'YOUR_ASSIGNED_REP_FIELD_ID');
  const assignedRep = assignedRepField ? assignedRepField.value : 'Unassigned';

  return {
    json: {
      contact_id: item.json.id,
      contact_name: item.json.contactName,
      first_name: item.json.firstName,
      last_name: item.json.lastName,
      email: item.json.email || 'No email provided',
      phone: item.json.phone || 'No phone provided',
      company_name: item.json.companyName || 'N/A',
      lead_score: leadScore,
      assigned_rep: assignedRep,
      assigned_rep_slack_id: assignedRep, // TODO: Map to actual Slack member IDs
      location_id: item.json.locationId,
      source: item.json.source || 'Unknown',
      tags: Array.isArray(item.json.tags) ? item.json.tags.join(', ') : '',
      country: item.json.country,
      date_added: item.json.dateAdded,
      date_updated: item.json.dateUpdated,
      is_high_priority: leadScore > 80 // Boolean flag for workflow filtering
    }
  };
});

